import React from "react";

// Navbar Component
function Navbar() {
    return (
        <nav style={styles.navbar}>
            <div style={styles.navLogo}>Suivi Patient</div>
            <ul style={styles.navLinks}>
                <li><a href="#home" style={styles.navLink}>Home</a></li>
                <li><a href="#services" style={styles.navLink}>Services</a></li>
                <li><a href="#notifications" style={styles.navLink}>Notification</a></li>
                <li><a href="#appointments" style={styles.navLink}>Rendez-vous</a></li>
                <li><a href="#login" style={styles.navLink}>Login</a></li>
                <li><a href="#signup" style={styles.navLink}>Sign Up</a></li>
            </ul>
        </nav>
    );
}

// Footer Component
function Footer() {
    return (
        <footer style={styles.footer}>
            <p>¬© 2024 Suivi Patient App. Tous droits r√©serv√©s.</p>
            <p>Contactez-nous : contact@suivipatient.com</p>
        </footer>
    );
}

// HomePage Component
function HomePage() {
    return (
        <div>
            {/* Navbar */}
            <Navbar />

            {/* Main Sections */}
            <section id="home" style={styles.homeSection}>
                <div style={styles.overlay}>
                    <h1 style={styles.sectionTitle}>Bienvenue sur Suivi Patient</h1>
                    <p style={styles.sectionText}>G√©rez facilement vos donn√©es de sant√© et vos rendez-vous.</p>
                </div>
            </section>

            <section id="services" style={styles.section}>
                <h2 style={styles.sectionTitle}>Nos Services</h2>
                <ul style={styles.list}>
                    <li>Gestion des patients</li>
                    <li>Suivi des donn√©es de sant√©</li>
                    <li>Rappel de rendez-vous</li>
                    <li>Notifications en temps r√©el</li>
                </ul>
            </section>

            <section id="notifications" style={styles.section}>
                <h2 style={styles.sectionTitle}>Notifications</h2>
                <p style={styles.sectionText}>Recevez des notifications importantes sur vos rendez-vous et vos donn√©es de sant√©.</p>
            </section>

            <section id="appointments" style={styles.section}>
                <h2 style={styles.sectionTitle}>Rendez-vous</h2>
                <p style={styles.sectionText}>Planifiez et suivez vos rendez-vous m√©dicaux en quelques clics.</p>
            </section>

            {/* Footer */}
            <Footer />
        </div>
    );
}

// Styles
const styles = {
    navbar: {
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        padding: "10px 20px",
        backgroundColor: "#007bff",
        color: "white",
        position: "sticky",
        top: 0,
        zIndex: 1000,
    },
    navLogo: {
        fontSize: "24px",
        fontWeight: "bold",
    },
    navLinks: {
        listStyle: "none",
        display: "flex",
        gap: "15px",
        margin: 0,
        padding: 0,
    },
    navLink: {
        textDecoration: "none",
        color: "white",
        fontSize: "16px",
    },
    homeSection: {
        height: "300px",
        backgroundImage: "url('/image/welcome-background.webp')",
        backgroundSize: "cover",
        backgroundPosition: "center",
        position: "relative",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        color: "white",
    },
    overlay: {
        backgroundColor: "rgba(0, 0, 0, 0.5)", // Assombrit l'arri√®re-plan pour rendre le texte lisible
        padding: "20px",
        borderRadius: "10px",
        textAlign: "center",
    },
    section: {
        padding: "50px 20px",
        textAlign: "center",
        borderBottom: "1px solid #ddd",
        backgroundColor: "#f9f9f9",
    },
    sectionTitle: {
        fontSize: "28px",
        margin: "0 0 10px",
    },
    sectionText: {
        fontSize: "18px",
        margin: 0,
    },
    list: {
        listStyle: "none",
        padding: 0,
        fontSize: "18px",
    },
    footer: {
        backgroundColor: "#007bff",
        textAlign: "center",
        color: "white",
        padding: "20px",
        marginTop: "20px",
    },
};

export default HomePage;
